ar i = 0, l = nums.length; i &lt; l; i++)\n        accumulator += nums[i];\n      return accumulator;\n    }\n\n    function rbeta(alpha, beta) {\n      var alpha_gamma = rgamma(alpha, 1);\n      return alpha_gamma / (alpha_gamma + rgamma(beta, 1));\n    }\n\n    var SG_MAGICCONST = 1 + Math.log(4.5);\n    var LOG4 = Math.log(4.0);\n\n    function rgamma(alpha, beta) {\n      if (alpha &gt; 1) {\n        var ainv = Math.sqrt(2.0 * alpha - 1.0);\n        var bbb = alpha - LOG4;\n        var ccc = alpha + ainv;\n\n        while (true) {\n          var u1 = Math.random();\n          if (!((1e-7 &lt; u1) &amp;&amp; (u1 &lt; 0.9999999))) {\n            continue;\n          }\n          var u2 = 1.0 - Math.random();\n          var v = Math.log(u1/(1.0-u1))/ainv;\n          var x = alpha*Math.exp(v);\n          var z = u1*u1*u2;\n          var r = bbb+ccc*v-x;\n          if (r + SG_MAGICCONST - 4.5*z &gt;= 0.0 || r &gt;= Math.log(z)) {\n            return x * beta;\n          }\n        }\n      }\n      else if (alpha == 1.0) {\n        var u = Math.random();\n        while (u &lt;= 1e-7) {\n          u = Math.random();\n        }\n        return -Math.log(u) * beta;\n      }\n      else { \n        while (true) {\n          var u3 = Math.random();\n          var b = (Math.E + alpha)/Math.E;\n          var p = b*u3;\n          if (p &lt;= 1.0) {\n            var x = Math.pow(p, (1.0/alpha));\n          }\n          else {\n            var x = -Math.log((b-p)/alpha);\n          }\n          var u4 = Math.random();\n          if (p &gt; 1.0) {\n            if (u4 &lt;= Math.pow(x, (alpha - 1.0))) {\n              break;\n            }\n          }\n          else if (u4 &lt;= Math.exp(-x)) {\n            break;\n          }\n        }\n        return x * beta;\n      }\n    }\n    \n    function rdirichlet(alpha) {\n      var gammas = [];\n      for (var i = 0, l = alpha.length; i &lt; l; i++)\n        gammas.push(rgamma(alpha[i], 1));\n        \n      var accum = sum(gammas)\n      \n      for (var i = 0, l = gammas.length; i &lt; l; i++)\n        gammas[i] = gammas[i]/accum\n      return gammas\n    }\n\n    function rcauchy() {\n      return rnormal() / rnormal();\n    }\n\n\n    function rbernoulli(p) {\n      if (Math.random() &lt; p)\n        return 1\n      else\n        return 0\n    }\n    \n    function rcategorical(pi){\n      var u = Math.random();\n      var k = 0\n      var cum = pi[0]\n      for (var i = 1, l = pi.length; i &lt; l; i++)\n        if (u &lt;= cum){\n            break;\n        }\n        else{\n            cum = cum + pi[i]\n            k = k+1\n        }\n      return k\n    }\n\n  function rpoisson(lambda) {\n    var L = Math.exp(-lambda);\n    var k = 0;\n    var p = 1;\n    do {\n      k++;\n      p *= Math.random();\n    } while (p &gt; L);\n    return k - 1;\n  }\n\n      \n    \n    const selectedProcess = process_select.value;\n    const selectedDistribution = distribution_select.value;\n    const numSets = num_sets_slider.value;\n    const numSamples = 101;  // Number of integers on the x-axis\n    const xValues = Array.from({ length: numSamples }, (_, i) =&gt; i);  // Array of integers from 0 to 100\n    \n    for (let set = 0; set &lt; numSets; set++) {\n        const x = xValues.slice();  // Clone the x-values array\n        const y = [];  // Create a new array for y\n                    \n        if (selectedDistribution === \"Uniform\") {\n            // Generate iid noise with a uniform distribution\n            var rand = function(){ return Math.random()};\n        }\n        else if (selectedDistribution === \"Normal\") {\n            // Generate iid noise with a normal distribution\n            var rand = function(){ return rnormal()};\n        }\n        else if (selectedDistribution === \"Gamma\") {\n            // Generate iid noise with a gamma distribution\n            var rand = function(){ return rgamma(1, 1)};\n        }\n        else if (selectedDistribution === \"Bernoulli\") {\n            // Generate iid noise with a bernoulli distribution\n            var rand = function(){ return rbernoulli(0.5)};\n        }\n        else if (selectedDistribution === \"Poisson\") {\n            // Generate iid noise with a poisson distribution\n            var rand = function(){ return rpoisson(1)};\n        }\n        else if (selectedDistribution === \"Cauchy\") {\n            // Generate iid noise with a cauchy distribution\n            var rand = function(){ return rcauchy()};\n        }\n                    \n    \n        \n        \n        if (selectedProcess === \"iid noise\") {\n           \n            for (let i = 0; i &lt; numSamples; i++) {\n                y.push(rand());\n            }\n        } else if (selectedProcess === \"random walk\") {\n            // Generate random walk\n            let currentValue = 0;\n            for (let i = 0; i &lt; numSamples; i++) {\n                currentValue += rand();\n                y.push(currentValue);\n            }\n        } else if (selectedProcess === \"geometric random walk\") {\n            // Generate geometric random walk\n            let currentValue = 1;\n            for (let i = 0; i &lt; numSamples; i++) {\n                currentValue *= rand();\n                y.push(currentValue);\n            }\n        }\n        \n        // Assign the new x and y arrays to the data source\n        if (data_sources[set]) {\n            data_sources[set].data.x = x;\n            data_sources[set].data.y = y;\n            data_sources[set].change.emit();\n        }\n    }\n                    \n    // Remove the extra data sources\n    for (let set = numSets; set &lt; data_sources.length; set++) {\n        if (data_sources[set]) {        \n            data_sources[set].data.x = [];\n            data_sources[set].data.y = [];\n            data_sources[set].change.emit();\n        }\n    }\n"},"id":"190584","type":"CustomJS"},{"attributes":{},"id":"196834","type":"Selection"},{"attributes":{}
